// Schema ufficiale esame - parametri per generazione dinamica
const exam_schema = {
  "TEORIA DELLO SCAFO": 1,
  "MOTORI": 1,
  "SICUREZZA DELLA NAVIGAZIONE": 3,
  "MANOVRA E CONDOTTA": 4,
  "COLREG E SEGNALAMENTO MARITTIMO": 2,
  "METEOROLOGIA": 2,
  "NAVIGAZIONE CARTOGRAFICA ED ELETTRONICA": 4,
  "NORMATIVA DIPORTISTICA E AMBIENTALE": 3
};

// Funzione per generare un esame random che rispetti i parametri ufficiali
function generateRandomExam() {
    const examQuestions = [];
    const usedQuestions = new Set();
    
    console.log('🎯 Generazione esame random con schema ufficiale...');
    
    // Per ogni categoria nell'esame schema
    for (const [category, requiredCount] of Object.entries(exam_schema)) {
        // Filtra domande di questa categoria
        const categoryQuestions = quiz_data_base.filter(q => 
            q.category === category && !usedQuestions.has(q.id)
        );
        
        if (categoryQuestions.length < requiredCount) {
            console.error(`❌ Categoria "${category}" ha solo ${categoryQuestions.length} domande disponibili, ne servono ${requiredCount}`);
            return null;
        }
        
        // Seleziona random il numero richiesto di domande
        const shuffled = [...categoryQuestions].sort(() => 0.5 - Math.random());
        const selected = shuffled.slice(0, requiredCount);
        
        // Aggiungi all'esame e marca come usate
        selected.forEach(q => {
            examQuestions.push(q);
            usedQuestions.add(q.id);
        });
        
        console.log(`✅ ${category}: selezionate ${selected.length}/${requiredCount} domande`);
    }
    
    // Mescola l'ordine finale delle domande
    const finalExam = examQuestions.sort(() => 0.5 - Math.random());
    console.log(`🎉 Esame generato: ${finalExam.length} domande totali`);
    
    return finalExam;
}

console.log('Quiz data loaded with exam schema for dynamic generation');
console.log('📊 Statistiche dataset:');
console.log(`  Base: ${quiz_data_base.length} domande`);
console.log(`  Vela: ${quiz_data_vela.length} domande`);
console.log('🎯 Use generateRandomExam() to create a new exam respecting official parameters');
